({params, imports}) => {
    const individual = params.entity;
    const formElement = params.formElement;

    const getBlockFromAddress = (address) => {
        if (!address) return "";
        if (address.locationMappings && address.locationMappings[0] && address.locationMappings[0].parent && address.locationMappings[0].parent.name) {
            return address.locationMappings[0].parent.name;
        }
        if (address.titleLineage) {
            const titleParts = address.titleLineage.split(', ');
            return titleParts.length > 2 ? titleParts[2] : "";
        }
        return "";
    };

    const getOtherBlockValue = (entity, blockName) => {
        const otherBlockUuid = "e2d35dee-c34f-4f54-a68b-f32ee81835b6";
        return blockName === 'Other' ? (entity.getObservationReadableValue(otherBlockUuid) || "") : "";
    };

    const getBlockDisplayName = (blockName, otherBlockValue) => {
        return blockName === 'Other' ? (otherBlockValue ? `Other (${otherBlockValue})` : 'Other') : blockName;
    };

    let visibility = true;
    let value = null;
    let answersToShow = [""];
    let answersToSkip = [];
    let validationErrors = [];

    const group = params.entityContext.group || {};
    const groupLowestAddressLevel = group.lowestAddressLevel;
    const groupVillageUUID = groupLowestAddressLevel && groupLowestAddressLevel.uuid;
    const groupVillageName = group.name || "";

    if (groupLowestAddressLevel && individual.lowestAddressLevel) {
        if (individual.lowestAddressLevel.name === 'Other') {
            const otherVillageText = individual.getObservationReadableValue("16b4db7c-e0a8-41f1-ac67-07470a762d9f");

            // Get group's block information
            const groupBlock = getBlockFromAddress(groupLowestAddressLevel);
            const isGroupBlockOther = groupBlock === 'Other';
            const groupOtherBlockValue = isGroupBlockOther ? getOtherBlockValue(group, groupBlock) : "";

            // Get individual's block information
            const individualBlock = getBlockFromAddress(individual.lowestAddressLevel);
            const isIndividualBlockOther = individualBlock === 'Other';
            const individualOtherBlockValue = isIndividualBlockOther ? getOtherBlockValue(individual, individualBlock) : "";

            // Compare village names and blocks
            const villageNameMatch = otherVillageText && groupVillageName && 
                otherVillageText.trim().toLowerCase() === groupVillageName.trim().toLowerCase();

            let blockMatch = true;
            if (isGroupBlockOther && isIndividualBlockOther) {
                blockMatch = groupOtherBlockValue && individualOtherBlockValue && 
                    groupOtherBlockValue.trim().toLowerCase() === individualOtherBlockValue.trim().toLowerCase();
            } else if (isGroupBlockOther) {
                blockMatch = groupOtherBlockValue && 
                    groupOtherBlockValue.trim().toLowerCase() === individualBlock.trim().toLowerCase();
            } else if (isIndividualBlockOther) {
                blockMatch = individualOtherBlockValue && 
                    groupBlock.trim().toLowerCase() === individualOtherBlockValue.trim().toLowerCase();
            } else {
                blockMatch = groupBlock.trim().toLowerCase() === individualBlock.trim().toLowerCase();
            }

            // Check for validation errors
            if (!villageNameMatch) {
                validationErrors.push(`Village '${otherVillageText || ""}' does not match the group's village '${groupVillageName || ""}'`);
            }
            if (!blockMatch) {
                const blockNameToShow = getBlockDisplayName(individualBlock, individualOtherBlockValue);
                const groupBlockToShow = getBlockDisplayName(groupBlock, groupOtherBlockValue);
                validationErrors.push(`Block '${blockNameToShow}' does not match the group's block '${groupBlockToShow}'`);
            }
        } else {
            const selectedVillage = individual.lowestAddressLevel.uuid;
            if (selectedVillage !== groupVillageUUID) {
                validationErrors.push("Selected village does not match the group's village");
            }
        }
    }

    return new imports.rulesConfig.FormElementStatus(
        formElement.uuid, 
        visibility, 
        value, 
        answersToSkip,
        validationErrors,
        answersToShow
    );
};

