({ params, imports }) => {
  const individual = params.entity;
  const formElement = params.formElement;

  const getBlockFromAddress = (address) => {
    if (!address) return undefined;
    if (Array.isArray(address.locationMappings) && 
        address.locationMappings[0] && 
        address.locationMappings[0].parent && 
        address.locationMappings[0].parent.name) {
      return address.locationMappings[0].parent.name;
    }
    if (address.titleLineage) {
      const titleParts = _.split(address.titleLineage, ', ');
      return titleParts.length > 2 ? titleParts[2] : undefined;
    }
    return undefined;
  };

  const getVillageBlock = (village) => {
    if (!village || !village.lowestAddressLevel) return "";
    const mappings = (village.lowestAddressLevel.locationMappings || []);
    if (mappings[0] && mappings[0].parent && mappings[0].parent.name) return mappings[0].parent.name;
    if (village.lowestAddressLevel.titleLineage) {
      const titleParts = village.lowestAddressLevel.titleLineage.split(', ');
      return titleParts.length > 2 ? titleParts[2] : "";
    }
    return "";
  };


  let visibility = params.db.objects('Individual').filter(i => i.uuid === individual.uuid).length > 0;
  let value = null;
  let answersToShow = [""];
  let answersToSkip = [];
  let validationErrors = [];

  const lowestAddressLevel = individual && individual.lowestAddressLevel;
  const isAddressDefined = lowestAddressLevel && 
    (Array.isArray(lowestAddressLevel.locationMappings) 
      ? !_.isEmpty(lowestAddressLevel.locationMappings) 
      : !_.isEmpty(lowestAddressLevel.titleLineage));

  const block = isAddressDefined ? getBlockFromAddress(lowestAddressLevel) : undefined;
  const individualAddressUuid = lowestAddressLevel && lowestAddressLevel.uuid;

  if (!individualAddressUuid) {
    validationErrors.push("Individual's address information is missing");
    return new imports.rulesConfig.FormElementStatus(
      formElement.uuid, visibility, value, answersToSkip, validationErrors, answersToShow
    );
  }

  const otherVillage = lowestAddressLevel && lowestAddressLevel.name === 'Other'
    ? individual.getObservationReadableValue("16b4db7c-e0a8-41f1-ac67-07470a762d9f")
    : null;

  let matchingVillages;

  if (lowestAddressLevel && lowestAddressLevel.name === 'Other' && otherVillage) {
    const allVillages = params.db.objects("Individual")
      .filtered('subjectType.uuid = $0', "c781319c-e47f-49f1-9ed7-7c85cd2bd16a");

    const otherVillageLower = otherVillage.toLowerCase();
    const individualBlock = block || "";
    const otherBlockUuid = "e2d35dee-c34f-4f54-a68b-f32ee81835b6";
    const otherBlockValue = individualBlock === "Other" 
      ? individual.getObservationReadableValue(otherBlockUuid) || ""
      : "";

    matchingVillages = Array.from(allVillages).filter(village => {
      const nameMatch = (village.name && village.name.toLowerCase().includes(otherVillageLower)) || false;
      const villageBlock = getVillageBlock(village).toLowerCase();

      let blockMatch = true;
      if (otherBlockValue) {
        blockMatch = villageBlock === otherBlockValue.toLowerCase();
      } else if (individualBlock) {
        blockMatch = villageBlock === individualBlock.toLowerCase();
      }

      return nameMatch && blockMatch;
    });
  } else {
    const villageQuery = `voided = false AND subjectType.uuid = "c781319c-e47f-49f1-9ed7-7c85cd2bd16a" AND lowestAddressLevel.uuid = $0`;
    matchingVillages = params.db.objects("Individual").filtered(villageQuery, individualAddressUuid);
  }

  if (matchingVillages.length === 0) {
    const villageName = otherVillage || (lowestAddressLevel && lowestAddressLevel.name) || 'Unknown';
    validationErrors.push(`No matching village found for: ${villageName}. Please check the village name or contact support.`);
  } else if (matchingVillages.length > 1) {
    validationErrors.push(`Multiple (${matchingVillages.length}) matching villages found. Please be more specific with the village name.`);
  } else {
    answersToShow = [matchingVillages[0].uuid];
    value = matchingVillages[0].name;
  }

  return new imports.rulesConfig.FormElementStatus(
    formElement.uuid, visibility, value, answersToSkip, validationErrors, answersToShow
  );
};

